--  DDL for Procedure ACTIVIDADESRESERVADAS
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "AGENTURI_OX"."ACTIVIDADESRESERVADAS" AS
BEGIN
    FOR rec IN (
        SELECT 
            c.first_name,
            c.last_name,
            p.name AS plan_name,
            a.name AS activity_name,
            a.extra_cost
        FROM Customer c
        JOIN Booking b ON c.id_customer = b.id_customer
        JOIN BookingActivity ba ON b.id_booking = ba.id_booking
        JOIN Activity a ON ba.id_activity = a.id_activity
        JOIN Plan p ON b.id_plan = p.id_plan
    ) LOOP
        DBMS_OUTPUT.PUT_LINE(
            rec.first_name || ' ' || rec.last_name || ' - ' ||
            rec.plan_name || ' - ' || rec.activity_name || ' - ' ||
            rec.extra_cost
        );
    END LOOP;
END;

