--------------------------------------------------------
--  DDL for Procedure CLIENTESEMPIEZANA
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "AGENTURI_OX"."CLIENTESEMPIEZANA" AS
BEGIN
    FOR rec IN (
        SELECT *
        FROM Customer
        WHERE first_name LIKE 'A%'
    ) LOOP
        DBMS_OUTPUT.PUT_LINE(
            rec.first_name || ' ' || rec.last_name
        );
    END LOOP;
END;

/
--------------------------------------------------------
--  DDL for Procedure CLIENTESPAGOMAYORPROMEDIO
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "AGENTURI_OX"."CLIENTESPAGOMAYORPROMEDIO" AS
BEGIN
    FOR rec IN (
        SELECT 
            c.id_customer,
            c.first_name,
            c.last_name,
            SUM(pay.amount) AS total_paid
        FROM Customer c
        JOIN Booking b ON c.id_customer = b.id_customer
        JOIN Payment pay ON b.id_booking = pay.id_booking
        GROUP BY c.id_customer, c.first_name, c.last_name
        HAVING SUM(pay.amount) > (
            SELECT AVG(amount) FROM Payment
        )
    ) LOOP
        DBMS_OUTPUT.PUT_LINE(
            'ID: ' || rec.id_customer || ' - ' ||
            rec.first_name || ' ' || rec.last_name || 
            ' | Total pagado: ' || rec.total_paid
        );
    END LOOP;
END;

