--------------------------------------------------------
--  DDL for Procedure DESTINOSCONCO
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "AGENTURI_OX"."DESTINOSCONCO" AS
BEGIN
    FOR rec IN (
        SELECT *
        FROM Destination
        WHERE LOWER(country) LIKE '%co%'
    ) LOOP
        DBMS_OUTPUT.PUT_LINE(
            'ID: ' || rec.id_destination || 
            ' | Nombre: ' || rec.name || 
            ' | País: ' || rec.country
        );
    END LOOP;
END;


