--------------------------------------------------------
--  DDL for Procedure PAGOS2025
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "AGENTURI_OX"."PAGOS2025" (p_cursor OUT SYS_REFCURSOR) AS
BEGIN
    OPEN p_cursor FOR
        SELECT 
            id_payment, 
            amount, 
            payment_date, 
            method
        FROM Payment
        WHERE payment_date BETWEEN 
            TO_DATE('2025-01-01', 'YYYY-MM-DD') 
            AND TO_DATE('2025-12-31', 'YYYY-MM-DD');
END;


