--  DDL for Procedure PLANESPRECIOMAYORPROMEDIO
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "AGENTURI_OX"."PLANESPRECIOMAYORPROMEDIO" (p_cursor OUT SYS_REFCURSOR) AS
BEGIN
    OPEN p_cursor FOR
        SELECT 
            id_plan,
            name AS plan_name,
            base_price
        FROM Plan
        WHERE base_price > (
            SELECT AVG(base_price) FROM Plan
        );
END;



