--------------------------------------------------------
--  DDL for Procedure TODASRESERVASNOMBRECLIENTEPLAN
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "AGENTURI_OX"."TODASRESERVASNOMBRECLIENTEPLAN" (p_cursor OUT SYS_REFCURSOR) AS
BEGIN
    OPEN p_cursor FOR
        SELECT
            b.id_booking,
            c.first_name,
            c.last_name,
            p.name AS plan_name,
            d.name AS destination_name,
            b.status
        FROM Booking b
        JOIN Customer c ON b.id_customer = c.id_customer
        JOIN Plan p ON b.id_plan = p.id_plan
        JOIN Destination d ON p.id_destination = d.id_destination;
END;

